import css from '../../Speaker.scss';

const Speaker = ({ speaker, twitter }) =>
  speaker ? (
    <p className={css.Speaker}>
      {speaker} / <a href={`https://twitter.com/${twitter}`}>@{twitter}</a>
    </p>
) : null;

export default Speaker;
